import React from 'react';
function CreateTicket() {
    return ( 
        <div className='container'>
            <div className='row mt-3'>
                <h4>To create a ticket, select a relevent topic</h4>
                <div className='col-4 mt-5 '>
                    <h6>Account Opening <i class="fa fa-plus-circle" aria-hidden="true"></i></h6>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16"}}> Online Account Opening</a>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16%"}}> Offline Account Opening</a>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16%"}}> Company, Partnership and HUF Account Opening</a>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16%"}}> NRI Account Opening</a>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16%"}}> Charges at Zerodha</a>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16%"}}> Zerodha IDFC FIRST Bank 3-in-1 Account</a>
                        <a href='*' style={{textDecoration:"none" , fontSize:"16%"}}> Getting Started</a>
                </div>

            </div>
        </div>
    );
}

export default CreateTicket;
